INSERT INTO casos_exitos VALUES(2,1669929696893,1684189008505,1670502357859,1,2,'Vivi''s Party',replace('Licenciada Nohema **Munguía**, empresaria, quien lidera Vivi’s \n\n\n\n\nParty\nNohema Munguía se graduó de la carrera de Administración de Empresas en CEUTEC La Ceiba.\nDurante su trayectoria como estudiante formo parte del equipo administrativo de CEUTEC La Ceiba, desempeñando el cargo de Auxiliar de Caja y también apoyando en las actividades de graduación.\n“Con base a mi experiencia podría decirles que trabajen en lo que les gusta, luchen por sus ideas de negocio, sean perseverantes y disciplinados, establézcanse metas medibles y alcanzables y recordar que todo sacrificio tiene su recompensa”.\nNohema se destaca por ser luchadora, perseverante, creativa, soñadora y emprendedora; comenta que la actitud que se asume ante la vida es fundamental; que los pensamientos e ideas construyen realidades, pero para ello hay que actuar en consecuencia y ejecutar esas ideas.  \nSu principal emprendimiento Vivi’s Party, nace como resultado de una constante búsqueda de un modelo de negocio que le permitiera mejorar la economía familiar aplicando sus habilidades empresariales y así crecer profesionalmente.\n Vivi’s Party comenzó hace 4 años, su misión es brindar un servicio eficiente en el montaje y alquiler de mobiliario y equipo para todo tipo de eventos, cubriendo la expectativa de los clientes con calidad, puntualidad, responsabilidad e higiene. \nNohema menciona que está continuamente enfocada en su idea original, y está muy consciente que para satisfacer las necesidades de sus clientes se requiere innovación continua, por lo cual está atenta para poder ofrecer un servicio competitivo y que se adapte a los cambios de moda o tendencia de mercado.\n“Agradezco a CEI de Ceutec/Unitec por su compromiso de crear espacios para generar ideas de vanguardia y promover el emprendimiento a través de este tipo proyectos que producen beneficio particular y colectivo a la sociedad y que incentivan a sus estudiantes a poder materializar su idea de negocio a través de la experiencia de otros emprendedores”.\n“El emprendedor es un soñador que tiene la capacidad de convertir una idea en visión, y la visión en realidad”','\n',char(10)),'Vivi''s party nos permite alquilar inmobiliario para nuestras fiestas.');
INSERT INTO inicios VALUES(1,'AMAMOS AYUDARTE A CRECER','Te lanzamos con toda la fuerza posible, porque sabemos que la necesitas y porque no es momento de ponerse limites.','Casos de exito','Es un espacio creativo ideal para que emprendedores, son?adores y personas innovadoras se conecten y a trave?s de procesos de incubacio?n y aceleracio?n puedan hacer realidad sus suen?os. Es un espacio en donde mentores certificados ayudan a estudiantes a crecer con sus proyectos, a que no se desmotiven y sigan luchando por sus suen?os, y en este mismo espacio se capacitan constantemente desde habilidades blandas, hasta el aprendizaje de las metodologi?as ma?s avanzadas para emprender.',1670473911364,1671150545247,1670541689436,1,1);
